import React, { useState } from "react";
import "./../App.css"; // Importing CSS file for styling

// Importing images
import logoImg from "./../../src/assets/images/kamesh.jpg";
import hamMenuIcon from "./../../src/assets/images/ham-menu.svg";
import hamMenuCloseIcon from "./../../src/assets/images/ham-menu-close.svg";

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false); // Tracks if the menu is open or closed

  // Toggle the mobile menu visibility
  const toggleMenu = () => {
    setIsMenuOpen((prev) => !prev);
  };

  // Handle logo click to navigate to the homepage
  const handleLogoClick = () => {
    window.location.href = "/";
  };

  return (
    <header className="header">
      <div className="header__content">
        {/* Logo Section */}
        <div
          className="header__logo-container"
          onClick={handleLogoClick}
          style={{ cursor: "pointer" }}
        >
          <div className="header__logo-img-cont">
            <img
              src={logoImg}
              alt="Kamesh Pansare logo"
              className="header__logo-img"
            />
          </div>
          <span className="header__logo-sub">Kamesh Pansare</span>
        </div>

        {/* Navigation Section */}
        <div className="header__main">
          <ul className={`header__links ${isMenuOpen ? "header__links--open" : ""}`}>
            <li className="header__link-wrapper">
              <a href="./" className="header__link" onClick={toggleMenu}>
                Home
              </a>
            </li>
            <li className="header__link-wrapper">
              <a href="./#about" className="header__link" onClick={toggleMenu}>
                About
              </a>
            </li>
            <li className="header__link-wrapper">
              <a href="./#projects" className="header__link" onClick={toggleMenu}>
                Projects
              </a>
            </li>
            <li className="header__link-wrapper">
              <a href="./#experience" className="header__link" onClick={toggleMenu}>
                Experience
              </a>
            </li>
            <li className="header__link-wrapper">
              <a href="./#contact" className="header__link" onClick={toggleMenu}>
                Contact
              </a>
            </li>
          </ul>

          {/* Hamburger Menu */}
          <div className="header__main-ham-menu-cont" onClick={toggleMenu}>
            <img
              src={isMenuOpen ? hamMenuCloseIcon : hamMenuIcon}
              alt="Menu Toggle"
              className="header__main-ham-menu"
            />
          </div>
        </div>
      </div>

      {/* Mobile Menu */}
      {isMenuOpen && (
        <div className="header__sm-menu header__sm-menu--active">
          <div className="header__sm-menu-content">
            <ul className="header__sm-menu-links">
              <li className="header__sm-menu-link" onClick={toggleMenu}>
                <a href="./">Home</a>
              </li>
              <li className="header__sm-menu-link" onClick={toggleMenu}>
                <a href="./#about">About</a>
              </li>
              <li className="header__sm-menu-link" onClick={toggleMenu}>
                <a href="./#projects">Projects</a>
              </li>
              <li className="header__sm-menu-link" onClick={toggleMenu}>
                <a href="./#experience">Experience</a>
              </li>
              <li className="header__sm-menu-link" onClick={toggleMenu}>
                <a href="./#contact">Contact</a>
              </li>
            </ul>
          </div>
        </div>
      )}
    </header>
  );
};

export default Header;
